import React from "react";

const ProjectList = ({ projects, onRemove }) => {
  return (
    <ul>
      {projects.map((project) => (
        <li key={project.id}>
          {project.name}
          <button onClick={() => onRemove(project.id)}>Remove</button>
        </li>
      ))}
    </ul>
  );
};

export default ProjectList;
